import React from 'react'
import './App.css'

import { Movie } from './components/Movie'

import { movieArray } from './propTypes/propTypes'

export default function MovieRecommendation({ initialMovies }) {

    return (
        <>
                <Movie initialMovies={initialMovies} header={'Action'} />

                <Movie initialMovies={initialMovies} header={'comedy'} />

                <Movie initialMovies={initialMovies} header={'action'} />

                <Movie initialMovies={initialMovies} header={'romance'} />

                <Movie initialMovies={initialMovies} header={'drama'} />

                <Movie initialMovies={initialMovies} header={'drama'} />

        </>
    )
}

MovieRecommendation.propTypes = {
    initialMovies: movieArray
}
